import React from "react";
import Routes from "./Routes";
import { BrowserRouter as Router } from "react-router-dom";
import AuthApi from "./utils/createContext";

function App() {
  return (
    <AuthApi.Provider>
      {" "}
      <Router>
        <Routes />
      </Router>
    </AuthApi.Provider>
  );
}

export default App;
